//SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.0;
import '@openzeppelin/contracts/token/ERC20/ERC20.sol';
import '@openzeppelin/contracts/token/ERC20/IERC20.sol';
import '@openzeppelin/contracts/security/ReentrancyGuard.sol';
import '@openzeppelin/contracts/utils/math/SafeMath.sol';
import '@openzeppelin/contracts/access/Ownable.sol';

interface ISeed {
    function getSeed() external returns(uint256);
}

interface IFwarBlackList {
    function isBlackList(address _address) external view returns (bool);
}

contract FWTDelegate is Ownable, ReentrancyGuard {
    using SafeMath for uint;

    address public fwtAddress;
    //Seed Address
    address public seedAddress;
    //FwarBlackList Address
    address public blackListAddress;

    mapping(address => uint) tokenAmounts;

    event Claim(address indexed _caller, uint amount);

    constructor(address _fwtAddress, address _seedAddress, address _blackListAddress) {
        fwtAddress = _fwtAddress;
        seedAddress = _seedAddress;
        blackListAddress = _blackListAddress;
    }

    receive() external payable{}

    function setFWTAddress(address _fwtAddress) external onlyOwner {
        fwtAddress = _fwtAddress;
    }

    function setSeedAddress(address _seedAddress) external onlyOwner{
        seedAddress = _seedAddress;
    }

    function setBlackListAddress(address _blackListAddress) external onlyOwner{
        blackListAddress = _blackListAddress;
    }

    function addAmount(address _userAdd, uint _amount) external onlyOwner{
        require(_userAdd != address(0), "User address error");
        require(_amount > 0, "Amount must greater than 0");

        tokenAmounts[_userAdd] = tokenAmounts[_userAdd].add(_amount);
    }

    function setListReward(address[] calldata _userAdds, uint[] calldata _amounts) external onlyOwner{
        for (uint i = 0; i < _userAdds.length; i++) {
            require(_userAdds[i] != address(0), "User address error");
            require(_amounts[i] > 0, "Amount must greater than 0");

            tokenAmounts[_userAdds[i]] = tokenAmounts[_userAdds[i]].add(_amounts[i]);
        }

    }

    function setListRewardUncheck(address[] calldata _userAdds, uint[] calldata _amounts) external onlyOwner{
        for (uint i = 0; i < _userAdds.length; i++) {
            tokenAmounts[_userAdds[i]] = tokenAmounts[_userAdds[i]].add(_amounts[i]);
        }
    }

    function getAmount(address _userAdd) public view returns (uint amount){
        amount = tokenAmounts[_userAdd];
    }

    function claim() external nonReentrant{
        require(_msgSender() == tx.origin, "FWTVL: Can not call from contract");
        require(!IFwarBlackList(blackListAddress).isBlackList(_msgSender()), "FWTVL: you are in black list");

        //Call for generate new seed for random
        ISeed(seedAddress).getSeed();

        uint amount = tokenAmounts[_msgSender()];

        uint fwtBalance = IERC20(fwtAddress).balanceOf(address(this));
        require(fwtBalance >= amount, "FWTVL: blance of token is not enough for claim!");

        tokenAmounts[_msgSender()] = 0;
        ERC20(fwtAddress).transfer(_msgSender(), amount);

        emit Claim(_msgSender(),amount);
    }

    // function to allow admin to claim *other* ERC20 tokens sent to this contract (by mistake)
    function withdrawERC20Tokens(address _tokenAddress, uint _amount) external onlyOwner {
        ERC20(_tokenAddress).transfer(_msgSender(), _amount);
    }
}
